bio:
I'm working as a full-time Computer Vision engineer at Roadly Inc. I'm responsible for the full work-life of Model creation:
* Field Exploration - which architectures are currently SOTA for this task, which datasets are currently used;
* Data Gathering - explore different datasets/websites/videos, their copyrights, and perform web scraping;
* Data Annotation - prepare instructions for the annotation team, choose the right annotation platform for the task, and sometimes perform the annotation itself;
* Model Training - perform hyperparameter tuning, and compare different architectures on the given task. Prepare reports on findings;
* Prepare Model for Deploy - compress and export the model to gain the desired inference speed.
* Deploying Models - post-process raw model results and package the whole process in a container
